use function Datashaman\Logic\curry;
use function Datashaman\Logic\either;
use function Datashaman\Logic\mkLeft;
use function Datashaman\Logic\mkRight;

$s = mkLeft('foo');
$n = mkRight(3);

echo either(
    function ($value) {
        return strlen($value);
    },
    function ($value) {
        return $value * 2;
    },
    $s
) . PHP_EOL;

echo either(
    function ($value) {
        return strlen($value);
    },
    function ($value) {
        return $value * 2;
    },
    $n
) . PHP_EOL;

// Or use currying

$f = curry(
    'Datashaman\Logic\either',
    function ($value) {
        return strlen($value);
    },
    function ($value) {
        return $value * 2;
    }
);

echo $f($s) . PHP_EOL;
echo $f($n) . PHP_EOL;

